original_question:
$\textbf{Mga Lumang Lugar ni Juan sa Pagkolekta ng Selyo}$

Inaayos ni Juan ang mga selyo sa kanyang koleksyon ayon sa bansa at dekada kung kailan ito inilabas. Ang mga presyo na binayaran niya para sa mga ito sa isang tindahan ng selyo ay: Brazil at France, $6$ sentimos bawat isa, Peru $4$ sentimos bawat isa, at Spain $5$ sentimos bawat isa. (Ang Brazil at Peru ay mga bansa sa Timog Amerika at ang France at Spain ay nasa Europa.) [asy]
/* AMC8 2002 #8, 9, 10 Problem */
size(3inch, 1.5inch);
for ( int y = 0; y <= 5; ++y )
{

draw((0,y)--(18,y));
}
draw((0,0)--(0,5));
draw((6,0)--(6,5));
draw((9,0)--(9,5));
draw((12,0)--(12,5));
draw((15,0)--(15,5));
draw((18,0)--(18,5));

label(scale(0.8)*"50s", (7.5,4.5));
label(scale(0.8)*"4", (7.5,3.5));
label(scale(0.8)*"8", (7.5,2.5));
label(scale(0.8)*"6", (7.5,1.5));
label(scale(0.8)*"3", (7.5,0.5));

label(scale(0.8)*"60s", (10.5,4.5));
label(scale(0.8)*"7", (10.5,3.5));
label(scale(0.8)*"4", (10.5,2.5));
label(scale(0.8)*"4", (10.5,1.5));
label(scale(0.8)*"9", (10.5,0.5));

label(scale(0.8)*"70s", (13.5,4.5));
label(scale(0.8)*"12", (13.5,3.5));
label(scale(0.8)*"12", (13.5,2.5));
label(scale(0.8)*"6", (13.5,1.5));
label(scale(0.8)*"13", (13.5,0.5));

label(scale(0.8)*"80s", (16.5,4.5));
